import React from 'react';
import './Filler1.css'
import mw from '../Assets/waterFall.jpg'

const Filler1 = () => {
  return (
    <div className='filler1'>
      <div className="f11">
        <img src={mw} alt="" />
        <h1>Welcome to <br /> <span>Trip-Up </span> </h1>
        <h2> Your Ultimate Travel Companion</h2>
      </div>
      div.intro
   </div>
  )
}

export default Filler1
